import React, { useRef } from 'react';
import './Projects.css';
import github from './assets/github.png';
import uga from './assets/uga.png'
import defaultImg from './assets/Personal-web-picture.png';

const Projects = () => {

    const projects = [
        {
            title: 'Deep Leakage From Gradients',
            img: uga,
            description: 'Language: Python \n Libraries: PyTorch, TensorFlow, TorchVision, Numpy, and Matplotlib',
            link:'https://github.com/amendoza09/gradient_inversion_attack',
        },
        {
            title: 'LevelUp Fitness',
            img: defaultImg,
            description: 'Langauge: JavaScript \n Tools: React, Node.JS, MongoDB',
            link: 'link',
        },
        {
            title: 'Splunk Dashbaord',
            img: defaultImg,
            description: 'Splunk',
            link: 'link',
        },
        {
            title: 'Bulldog Buddies',
            img: defaultImg,
            description: 'Language: JavaScript \n Tools: React, Node.JS, Google Firebase',
            link: 'link',
        },
        {
            title: 'Command Shell',
            img: defaultImg,
            description: 'Langauge: C, \n Low Level I/O ',
            link: 'link',
        },
        {
            title: 'Chess Game',
            img: defaultImg,
            description: 'Langauge: Python, \n used PyGame',
            link: 'link',
        },
        {
            title: 'Personal Website',
            img: defaultImg,
            description: 'Langauge: JavaScript, \n Used React',
            link: 'link',
        },
    ];

    return (
    <section className="projects">
        <h2>My Projects</h2>
        <div className="carousel-container">
            <div className="project-carousel">
                {projects.map((project, index) => (
                    <div key={index} className="project-card">
                        <h3 className="proj-title">{project.title}</h3>
                        <div className="image-container"> 
                            <img className="proj-image" src={project.img} alt="project picture"/>
                            <div className="proj-description">
                                <p>{project.description}</p>
                            </div>
                        </div>
                        <a href={project.link} target="_blank" rel="noopener noreferrer"><img src={github} className="logo" alt="github-logo"/></a>
                    </div> 
                ))}
            </div>
        </div>
    </section>
    );
};

export default Projects;
